import { Box, HStack, Input } from "@chakra-ui/react";
import React, { useEffect, useState } from "react";
import axios from "axios";

import "./App.css";

function App() {
  const url = "http://localhost:8005/questions";

  const [posts, setPosts] = useState();
      console.log(posts);


      function getUser() {
        axios.get(url)
          .then((response) => {
            setPosts(response.data);
          })
          .catch((error) => console.log(error));
      }
    
    
      useEffect(() => {
        getUser()
      }, []);
    


  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
            <HStack spacing="8">
              <Box w="100%" ml="5%" mt="5%">
              
                <Input
                  className="wrap-input"
                  id="cpfInput"
                  onChange={(e) => (e.target.value)}
                />                
               
              </Box>
            
            </HStack>
      </div><br></br><br></br>
          <div className="perguntas">
          {posts.lenght === 0? (
            <p>Carregando...</p>
          ):(
            posts.map((post)=>(
              <div key={posts._id}>
              <p>CPF: {posts.cpf}</p>
              <p>Nome: {posts.name}</p>
            </div>
            ))
                 
                )} 
          </div>
          </div>
    </div>
    
  )
}

export default App
